        function getphoto () {

            $container_selector_i = "#instagram_container";
            $.ajax({
                url: '/api/instagram/6',
                dataType: 'json',
                type: 'GET',
                success: function(res){
                    console.log(res, 'res')
                    $image_holders = $($container_selector_i).children();

                    for (var i = 0; i < res.data.length; i++) {
                        $($image_holders[i]).find('a').attr('href', res.data[i].link);
                        $($image_holders[i]).find('img').attr('src',  res.data[i].image_url);
                    }
                },
                error: function(result){
                    console.log(result);
                }
            });

        }
        function getYoutube() {
            jQuery(function($){
